import React from "react";

import "./Actions.css";
import Button from "../button/Button";

const Actions = () => {
	return (
		<div className="actions">
			<Button type="button" buttonStyle="btn--secondary" buttonSize="btn--small">Log In</Button>
            <Button type="button" buttonStyle="btn--primary">Sign Up</Button>
			<div>Profile</div>
		</div>
	);
};

export default Actions;
